/*Table structure for table `cpns` */

DROP TABLE IF EXISTS `cpns`;

CREATE TABLE `cpns` (
  `id_pegawai` int(11) NOT NULL AUTO_INCREMENT,
  `nip_pegawai` varchar(50) NOT NULL,
  `golongan_ruang` varchar(200) NOT NULL,
  `no_sk_cpns` varchar(50) NOT NULL,
  `tanggal_sk_cpns` varchar(10) NOT NULL,
  `nomor_persetujuan` varchar(50) NOT NULL,
  `tanggal_persetujuan` varchar(10) NOT NULL,
  `gaji_pokok` varchar(30) NOT NULL,
  `tmt_golongan` varchar(10) NOT NULL,
  `masa_kerja` varchar(10) NOT NULL,
  `pejabat_penandatangan_sk` varchar(200) NOT NULL,
  `dokumen_sk_cpns` varchar(100) NOT NULL,
  `path_dokumen_sk_cpns` varchar(200) NOT NULL,
  PRIMARY KEY (`id_pegawai`),
  UNIQUE KEY `id_pegawai` (`id_pegawai`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

