/*Table structure for table `pasangan` */

DROP TABLE IF EXISTS `pasangan`;

CREATE TABLE `pasangan` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_pegawai` int(11) NOT NULL,
  `nip_pegawai` varchar(50) NOT NULL,
  `nama` varchar(200) NOT NULL,
  `hubungan_keluarga` varchar(100) NOT NULL,
  `nik` varchar(20) NOT NULL,
  `pekerjaan` varchar(200) NOT NULL,
  `nomor_kartu` varchar(50) NOT NULL,
  `alamat_kantor` varchar(200) NOT NULL,
  `tempat_lahir` varchar(100) NOT NULL,
  `tanggal_lahir` varchar(50) NOT NULL,
  `file_foto` varchar(200) NOT NULL,
  `path_file_foto` varchar(200) NOT NULL,
  `buku_nikah` varchar(200) NOT NULL,
  `path_buku_nikah` varchar(200) NOT NULL,
  `agama` varchar(50) NOT NULL,
  `status_kesehatan` varchar(100) NOT NULL,
  `pendidikan` varchar(150) NOT NULL,
  `masih_hidup` varchar(50) NOT NULL,
  `berhak_tunjangan` varchar(50) NOT NULL,
  `status_perkawinan` varchar(200) NOT NULL,
  `tanggal_nikah` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=latin1;

