  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_pegawai` int(11) NOT NULL,
  `kode` varchar(100) NOT NULL,
  `tanggal_absen` varchar(15) NOT NULL,
  `jam_masuk` varchar(15) NOT NULL,
  `jam_pulang` varchar(15) NOT NULL,
  PRIMARY KEY (`id`)
